// import ReactSlider from 'react-slider';

const ReportPainLevels = () => {
  return (
    <body>
      {/* <ReactSlider /> */}
      <input type='range' defaultValue='0' min='0' max='10' list='ticks' />
      <datalist id='ticks'>
        <option>0</option>
        <option>1</option>
        <option>2</option>
        <option>3</option>
        <option>4</option>
        <option>5</option>
        <option>6</option>
        <option>7</option>
        <option>8</option>
        <option>9</option>
        <option>10</option>
      </datalist>
    </body>
  );
};

export default ReportPainLevels;
